def transform(sequence):
    new_sequence = []
    for i in range(len(sequence)):
        if sequence[i] == '6' or sequence[i] == '5':
            new_sequence.append('5')
        else:
            new_sequence.append(sequence[i])
    return ''.join(new_sequence)
